import React from 'react';
import './App.css';
import Home from './Pages/Home';
import Admin from './Pages/Admin';
import Header from './Components/Header';
import Footer from './Components/Footer';
function App() {
  return (
    <div className="App">
      <Header/>
      <header className="App-header">
       <Home/>
       <Admin/>
       <Footer/>
      </header>
    </div>

  );
}

export default App;
